(7,7,'用户隐私协议在此特别提醒您（用户）在注册成为用户之前，请认真阅读本《用户协议》（以下简称“协议”），确保您充分理解本协议中各条款。请您审慎阅读并选择接受或不接受本协议。您的注册、登录、使用等行为将视为对本协议的接受，并同意接受本协议各项条款的约束。本协议约定重庆天亿汇融信息技术咨询有限公司（（以下简称“觅趣”）与用户之间关于“觅趣”软件服务（以下简称“服务“）的权利义务。“用户”是指注册、登录、使用本服务的个人。本协议可由觅趣随时更新，更新后的协议条款一旦公布即代替原来的协议条款，恕不再另行通知，用户可在本APP中查阅最新版协议条款。在修改协议条款后，如果用户不接受修改后的条款，请立即停止使用觅趣提供的服务，用户继续使用服务将被视为接受修改后的协议。&nbsp; &nbsp; 一、账号注册 1、用户在使用本服务前需要注册一个“觅趣”账号。“觅趣”账号应当使用手机号码绑定注册，请用户使用尚未与“觅趣”账号绑定的手机号码，以及未被服务根据本协议封禁的手机号码注册“觅趣”账号。服务可以根据用户需求或产品需要对账号注册和绑定的方式进行变更，而无须事先通知用户。&nbsp; 2、“觅趣”系基于“觅趣“的APP产品，用户注册时应当授权觅趣及使用其个人信息方可成功注册“觅趣”账号。故用户完成注册即表明用户同意服务提取、公开及使用用户的信息。&nbsp; 3、鉴于“觅趣”账号的绑定注册方式，您同意服务在注册时将允许您的手机号码及手机设备识别码等信息用于注册。&nbsp; 4、在用户注册及使用本服务时，觅趣需要搜集能识别用户身份的个人信息以便服务可以在必要时联系用户，或为用户提供更好的使用体验。觅趣搜集的信息包括但不限于用户的姓名、地址；觅趣同意对这些信息的使用将受限于第三条用户个人隐私信息保护的约束。&nbsp; &nbsp; 二、用户个人隐私信息保护 1、如果觅趣发现或收到他人举报或投诉用户违反本协议约定的，觅趣有权不经通知随时对相关内容，包括但不限于用户资料、发贴记录进行审查、删除，并视情节轻重对违规账号处以包括但不限于警告、账号封禁 、设备封禁 、功能封禁 的处罚，且通知用户处理结果。&nbsp; 2、因违反用户协议被封禁的用户，可以自行与觅趣联系。其中，被实施功能封禁的用户会在封禁期届满后自动恢复被封禁功能。被封禁用户可提交申诉，觅趣将对申诉进行审查，并自行合理判断决定是否变更处罚措施。&nbsp; 3、用户理解并同意，觅趣有权依合理判断对违反有关法律法规或本协议规定的行为进行处罚，对违法违规的任何用户采取适当的法律行动，并依据法律法规保存有关信息向有关部门报告等，用户应承担由此而产生的一切法律责任。&nbsp; 4、用户理解并同意，因用户违反本协议约定，导致或产生的任何第三方主张的任何索赔、要求或损失，包括合理的律师费，用户应当赔偿觅趣与合作公司、关联公司，并使之免受损害。&nbsp; &nbsp; 三、用户发布内容规范 1、本条所述内容是指用户使用服务的过程中所制作、上载、复制、发布、传播的任何内容，包括但不限于账号头像、名称、用户说明等注册信息及认证资料，或文字、语音、图片、视频、图文等发送、回复或自动回复消息和相关链接页面，以及其他使用账号或本服务所产生的内容。&nbsp; 2、用户不得利用“觅趣”账号或本服务制作、上载、复制、发布、传播如下法律、法规和政策禁止的内容：&nbsp; (1) 反对宪法所确定的基本原则的；&nbsp; (2) 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；&nbsp; (3) 损害国家荣誉和利益的；&nbsp; (4) 煽动民族仇恨、民族歧视，破坏民族团结的；&nbsp; (5) 破坏国家宗教政策，宣扬邪教和封建迷信的；&nbsp; (6) 散布谣言，扰乱社会秩序，破坏社会稳定的；&nbsp; (7) 散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；&nbsp; (8) 侮辱或者诽谤他人，侵害他人合法权益的；&nbsp; (9) 含有法律、行政法规禁止的其他内容的信息。&nbsp; 3、用户不得利用“觅趣”账号或本服务制作、上载、复制、发布、传播如下干扰“服务”正常运营，以及侵犯其他用户或第三方合法权益的内容：&nbsp; (1) 含有任何性或性暗示的；&nbsp; (2) 含有辱骂、恐吓、威胁内容的；&nbsp; (3) 含有骚扰、垃圾广告、恶意信息、诱骗信息的；&nbsp; (4) 涉及他人隐私、个人信息或资料的；&nbsp; (5) 侵害他人名誉权、肖像权、知识产权、商业秘密等合法权利的；&nbsp; (6) 含有其他干扰本服务正常运营和侵犯其他用户或第三方合法权益内容的信息。&nbsp; &nbsp; 四、使用规则 1、用户在本服务中或通过本服务所传送、发布的