) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_charm`;
CREATE TABLE `platform_charm` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '魅力名称',
  `grade` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '等级',
  `icon` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '图标',
  `integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '积分数',
  `text_fee` int(10) unsigned NOT NULL DEFAULT '20' COMMENT '普通消息收费',
  `voice_fee` int(10) unsigned NOT NULL DEFAULT '200' COMMENT '语音消息收费',
  `video_fee` int(10) unsigned NOT NULL DEFAULT '200' COMMENT '视频消息收费',
  `view_picture_fee` int(10) unsigned NOT NULL DEFAULT '20' COMMENT '颜照库收费',
