  `platform_video_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '平台图片审核方式0=人工审核，1=系统审核，关闭审核',
  `headpic_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '头像审核0=审核，1=不审核',
  `picture_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '图片审核0=审核，1=不审核',
  `video_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '视频审核0=审核，1=不审核',
  `nickname_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '昵称审核0=审核，1=不审核',
  `signature_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '签名审核0=审核，1=不审核',
  `aphorism_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '格言审核0=审核，1=不审核',
  `chat_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '文本信息审核0=审核，1=不审核',
  `realname_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '实名审核0=审核，1=不审核',
  `selfie_audit` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '自拍审核0=审核，1=不审核',
  `selfie_realname` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '自拍前实名0=需要，1=不需要',
  `signin_award` int(10) unsigned NOT NULL DEFAULT '200' COMMENT '签到奖励金币数量',
  `online_robot` int(10) unsigned NOT NULL DEFAULT '10' COMMENT '在线陪聊',
  `charm_period` int(10) unsigned NOT NULL DEFAULT '15' COMMENT '魅力统计周期',
  `charm_online_duration_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '魅力在线时长权重',
  `charm_totalk_duration_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '魅力被叫通话时长权重',
  `charm_togift_gold_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '魅力接收礼物能量数权重',
  `charm_tolike_count_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '魅力接收点赞数权重',
  `vip_period` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'VIP统计周期0不限',
  `vip_online_duration_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT 'VIP在线时长权重',
  `vip_fromtalk_duration_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT 'VIP主叫通话时长权重',
  `vip_fromgift_gold_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT 'VIP赠送礼物能量数权重',
  `vip_fromlike_count_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT 'VIP点赞数权重',
  `vip_recharge_total_weight` int(10) unsigned NOT NULL DEFAULT '1' COMMENT 'VIP充值合计权重',
  `withdraw_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.1000' COMMENT '提现费率',
  `withdraw_min` decimal(12,4) unsigned NOT NULL DEFAULT '100.0000' COMMENT '最小提现金额',
  `withdraw_max` decimal(12,4) unsigned NOT NULL DEFAULT '10000.0000' COMMENT '最大提现金额',
  `withdraw_day_max` decimal(12,4) unsigned NOT NULL DEFAULT '10000.0000' COMMENT '日最大提现金额',
  `withdraw_day_count` decimal(12,4) unsigned NOT NULL DEFAULT '1.0000' COMMENT '日最大提现次数',
  `recharge_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.1000' COMMENT '充值费率',
  `recharge_min` decimal(12,4) unsigned NOT NULL DEFAULT '100.0000' COMMENT '最小充值金额',
  `recharge_max` decimal(12,4) unsigned NOT NULL DEFAULT '100000.0000' COMMENT '最大充值金额',
  `gold_rate` decimal(12,4) unsigned NOT NULL DEFAULT '80.0000' COMMENT '金币兑换比例',
  `conversion_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.8000' COMMENT '会员兑换手续费',
  `conversion_min` decimal(12,4) unsigned NOT NULL DEFAULT '100.0000' COMMENT '最小兑换金币',
  `invitation_energy` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000',
  `register_energy` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态。0=正常，1=禁用',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `versions` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '版本号',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `recommender_income_rate` decimal(12,2) DEFAULT '0.00',
  `recommender_recharge_rate` decimal(12,2) DEFAULT '0.00',
  `unanswered` decimal(12,2) DEFAULT '0.00',
  `user_age` int(10) unsigned DEFAULT '0',
  `superior_revenue_time` int(10) unsigned DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_levels`;
CREATE TABLE `platform_levels` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '规则类型（0积分 1富豪 2魅力）',
  `level` tinyint(4) NOT NULL DEFAULT '0' COMMENT '会员级别',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '会员级别名称',
  `min_score` tinyint(4) NOT NULL DEFAULT '0' COMMENT '范围下限(最低)',
  `max_score` tinyint(4) NOT NULL DEFAULT '0' COMMENT '范围上限(最高)',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `notifications`;
CREATE TABLE `notifications` (
  `id` char(36) COLLATE utf8mb4_unicode_ci NOT NULL,
  `type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `notifiable_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `notifiable_id` bigint(20) unsigned NOT NULL,
  `data` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `read_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `notifications_notifiable_type_notifiable_id_index` (`notifiable_type`,`notifiable_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_user_rate`;
CREATE TABLE `member_user_rate` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
  `is_custom` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否定制费率0否1是',
  `gift_rate` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '礼物平台分成占比（%）',
  `chat_rate` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT '聊天解锁分成占比（%）',
  `text_rate` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT '通消息收费分成占比（%）',
  `voice_rate` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT '语音通话消费分成占比（%）',
  `video_rate` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT '视频通话消费分成占比（%）',
  `view_picture_rate` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT '图片查看分成占比（%）',
  `view_video_rate` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT '视频查看分成占比（%）',
  `middleman_income_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000',
  `middleman_recharge_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000',
  `chat_fee` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '聊天解锁收费',
  `text_fee` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '普通消息收费',
  `voice_fee` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '语音消息收费',
  `video_fee` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '视频消息收费',
  `view_picture_fee` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '颜照库收费',
  `view_video_fee` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '视频库收费',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0 正常 1禁用',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `recommender_income_rate` decimal(12,2) DEFAULT NULL,
  `recommender_recharge_rate` decimal(12,2) DEFAULT NULL,
  `superior_revenue_time` int(10) unsigned DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=138 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_notices`;
CREATE TABLE `platform_notices` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '通知类型0系统1用户',
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
