  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '类型',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '数量',
  `surplus` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '结余数量',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '交易备注',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `member_wallet_records_relevance_type_relevance_id_index` (`relevance_type`,`relevance_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1138 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `system_logs`;
CREATE TABLE `system_logs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `relevance_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `relevance_id` bigint(20) unsigned NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '标题',
  `type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '类型:0系统日志1策略日志2委托日志3券商日志4充值日志5提现日志6注册日志',
  `content` text COLLATE utf8mb4_unicode_ci COMMENT '日志内容',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `system_logs_relevance_type_relevance_id_index` (`relevance_type`,`relevance_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_logins`;
CREATE TABLE `member_logins` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
  `login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `login_ip` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '登录IP',
  `logout_time` datetime DEFAULT NULL COMMENT '登出时间',
  `duration` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '在线时长',
  `versions` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '客户端版本号',
  `platform` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '客户端手机平台',
  `client` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '客户端手机型号',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0正常  1禁用',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2872 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `agent_users`;
CREATE TABLE `agent_users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '编号',
  `member_id` int(10) unsigned NOT NULL COMMENT '所属会员',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '服务商名称',
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '邮箱',
  `email_verified_at` timestamp NULL DEFAULT NULL COMMENT '邮箱验证时间',
  `mobile` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '手机号',
  `mobile_verified_at` timestamp NULL DEFAULT NULL COMMENT '手机号验证时间',
  `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '登陆密码',
  `audit_status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '审核状态 0:通过 1:不通过  9待审核',
  `audit_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审核人',
  `audit_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '审核人',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0:正常 1:禁用 2:冻结',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `remember_token` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `agent_users_no_unique` (`no`),
  UNIQUE KEY `agent_users_member_id_unique` (`member_id`),
  UNIQUE KEY `agent_users_email_unique` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_basic`;
CREATE TABLE `platform_basic` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '数据类型(1.消息收费 2.语音收费 3.视频收费 4.颜照库收费 5.视频库收费 6.换衣收费 7.举报理由',
  `key` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '对应键',
  `value` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '对应值',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0启用 1禁用 ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_visitors`;
CREATE TABLE `member_visitors` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
  `to_member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所访问的会员编号',
  `last_time` datetime DEFAULT NULL COMMENT '最后访问时间',
  `last_ip` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '最后访问IP',
  `last_versions` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '最后客户端版本号',
  `last_platform` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '最后客户端手机平台',
  `number` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '访问次数',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1332 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `deal_likes`;
CREATE TABLE `deal_likes` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `relevance_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `relevance_id` bigint(20) unsigned NOT NULL,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '点赞者',
  `to_member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '被点赞者',
  `number` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '点赞次数',
  `total` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费合计',
  `platform_way` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '佣金分层方式，0能量，1金币',
  `platform_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '分层比例',
  `platform_commission` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '平台佣金',
  `received` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '接收方实到能量',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0:正常 1:禁用  9待审',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `deal_likes_relevance_type_relevance_id_index` (`relevance_type`,`relevance_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_blacklists`;
CREATE TABLE `member_blacklists` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '拉黑人',
  `to_member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '被拉黑人',
  `type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '拉黑原因',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态 0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `member_blacklists_member_id_to_member_id_unique` (`member_id`,`to_member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_rates`;
CREATE TABLE `platform_rates` (
