  `agent_recharge_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '服务商充值费率',
  `agent_golden_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '服务商收单费率',
  `agent_withdraw_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '服务商提现费率',
  `agent_payroll_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '服务商代付费率',
  `agent_settle_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '服务商结算费率',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `platform_rates_relevance_type_relevance_id_index` (`relevance_type`,`relevance_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_files`;
CREATE TABLE `platform_files` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `relevance_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `relevance_id` bigint(20) unsigned NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '文件名',
  `url` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '原始地址',
  `thumb` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '缩略图',
  `extension` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '扩展名',
  `size` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '文件大小',
  `width` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '宽度',
  `height` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '高度',
  `color` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '主色',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '状态 0:正常 1:禁用 9待审  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
