  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=138 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_users`;
CREATE TABLE `member_users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '会员编号',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '会员类型0普通用户1陪聊2客服',
  `level_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属等级ID',
  `group_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属分组ID',
  `agent_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属代理商ID(0无代理商)',
  `is_middleman` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否经济人0是1否9申请中',
  `parent_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '推荐人',
  `invite_code` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '邀请码(注册时自动生成)',
  `service_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '我的客服',
  `username` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户名',
  `mobile` varchar(11) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '手机号码',
  `mobile_verify` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '手机号验证 0通过 1失败9未知',
  `password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '登录密码',
  `capital_password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '资金密码',
  `nick_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '昵称',
  `head_pic` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '头像图片',
  `cover` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '封面图片',
  `sex` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '姓别 0男 1女9未知',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `resident` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '常驻城市',
  `province` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '所在省',
  `city` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '所在市城市',
  `district` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '所在县区',
  `lat` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '经度',
  `lng` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '纬度',
  `address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '详细地址',
  `aphorism` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '格言',
  `signature` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '签名',
  `charm_grade` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '魅力等级',
  `charm_integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '魅力积分',
  `vip_grade` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'VIP等级',
  `vip_integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'VIP积分',
  `vip_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'vip等级',
  `vip_end` date DEFAULT NULL COMMENT 'vip到期日期',
  `last_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `last_ip` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '最后更新IP',
  `hot` tinyint(4) NOT NULL DEFAULT '0' COMMENT '热门推荐指数',
  `online_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '在线状态:0在线1离线9未知 ',
  `im_status` tinyint(4) NOT NULL DEFAULT '9' COMMENT '在线状态: 0在线1离线2休眠9未知',
  `live_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '语音视频是否忙碌(0空闲 1忙碌)',
  `is_real` tinyint(4) NOT NULL DEFAULT '9' COMMENT '是否实名认证 0已认证1未认证8审核中9待认证',
  `is_selfie` tinyint(4) NOT NULL DEFAULT '9' COMMENT '是否自拍认证 0认证通过 1认证拒绝 8审核中 9待认证',
  `weixin_openid` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '微信OPENID',
  `unionid` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '微信开放平台OPENID',
  `im_token` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '三方imtoken',
  `push_token` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '推送token',
  `api_token` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户Token',
  `theme_id` tinyint(4) NOT NULL DEFAULT '0' COMMENT '用户主题',
  `app_platform` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'APP平台android,ios',
  `app_version` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'APP版本号',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0  正常1禁用',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remember_token` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `member_users_no_unique` (`no`),
  UNIQUE KEY `member_users_invite_code_unique` (`invite_code`),
  UNIQUE KEY `member_users_im_token_unique` (`im_token`),
  UNIQUE KEY `member_users_api_token_unique` (`api_token`),
  UNIQUE KEY `member_users_mobile_openid_unique` (`mobile`,`unionid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=154 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_theme`;
CREATE TABLE `platform_theme` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
