  `content` text COLLATE utf8mb4_unicode_ci COMMENT '内容',
  `atlas` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '图集',
  `grade` int(10) unsigned NOT NULL DEFAULT '9' COMMENT '评分',
  `finish_status` int(10) unsigned NOT NULL DEFAULT '9' COMMENT '完成状态9进行中，0已完结',
  `finish_time` datetime DEFAULT NULL COMMENT '完成时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0:正常 1:禁用 2:冻结',
