  `no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '单号',
  `gold` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '兑换金币',
  `conversion_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '金币兑换手续费费率',
  `conversion_commission` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '兑换手续费佣金',
  `received_gold` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实际兑换金币',
  `gold_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '金币兑换比例',
  `money` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '兑换后金额',
  `audit_uid` int(10) unsigned DEFAULT NULL COMMENT '经办人',
  `audit_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '经办人姓名',
  `audit_time` datetime DEFAULT NULL COMMENT '经办时间',
  `audit_reason` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '经办意见',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态(0正常  1禁止)',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `deal_conversions_no_unique` (`no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `failed_jobs`;
CREATE TABLE `failed_jobs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `connection` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `queue` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `payload` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `exception` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `failed_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `deal_gives`;
CREATE TABLE `deal_gives` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '订单编号',
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '赠送人',
  `to_member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '被赠送人',
  `money` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '打赏金额',
  `total` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费合计',
  `platform_way` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '佣金分层方式，0能量，1金币',
  `platform_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '分层比例',
  `platform_commission` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '平台佣金',
  `received` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '接收方实到能量',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '状态 0成功  1失败 8支付中 9待支付 ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `deal_gives_no_unique` (`no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_wallet_withdraws`;
CREATE TABLE `member_wallet_withdraws` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
  `no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '单号',
  `relevance_type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `relevance_id` bigint(20) unsigned DEFAULT NULL,
  `money` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '申请金额',
  `cost_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '成本费率',
  `cost_commission` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '成本佣金',
  `username` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户姓名',
  `bank_account` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行账号',
  `bank_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行名称',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `pay_status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '支付状态0成功1失败9支付中',
  `pay_remark` text COLLATE utf8mb4_unicode_ci COMMENT '支付备注',
  `audit_uid` int(10) unsigned DEFAULT NULL COMMENT '经办人',
  `audit_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '经办人姓名',
  `audit_time` datetime DEFAULT NULL COMMENT '经办时间',
  `audit_reason` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '经办意见',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态(0未审核  1审核通过 2审核拒绝 9待办)',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `deleted_at` timestamp NULL DEFAULT NULL,
