  UNIQUE KEY `member_wallet_withdraws_no_unique` (`no`),
  KEY `member_wallet_withdraws_relevance_type_relevance_id_index` (`relevance_type`,`relevance_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_tags`;
CREATE TABLE `platform_tags` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
