  `ico` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '标签图标',
  `thumb` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '缩略图',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '状态 0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
