  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `migrations`;
CREATE TABLE `migrations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `migration` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `batch` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_views`;
CREATE TABLE `member_views` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
  `relevance_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `relevance_id` bigint(20) unsigned NOT NULL,
  `gold` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '花费金币',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `member_views_relevance_type_relevance_id_index` (`relevance_type`,`relevance_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_wallets`;
CREATE TABLE `member_wallets` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
  `gold_balance` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '能量余额',
  `gold_usable` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '能量可用余额',
  `gold_freeze` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '能量冻结余额',
  `gold_platform` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '能量平台冻结余额',
  `money_balance` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '金币余额',
  `money_recharge` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '金币充值',
  `money_conversion` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '金币兑换现金',
  `money_commission` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '佣金奖励',
  `money_freeze` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '现金冻结余额',
  `money_platform` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '现金平台冻结余额',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态0 正常 1禁用',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `platform_payment_channels`;
CREATE TABLE `platform_payment_channels` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
