  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态 0:正常 1:禁用  ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `platform_payment_channels_code_unique` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `deal_talks`;
CREATE TABLE `deal_talks` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '订单编号',
  `room_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '房间编号',
  `dialing_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '主叫方',
  `called_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '被叫方',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '呼叫类型，0视频，1语音',
  `begin_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `duration` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '通话时间秒',
  `price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '单价金币/分',
  `total` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '呼叫方消费金币',
  `platform_way` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '佣金分层方式，0能量，1金币',
  `platform_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '分层比例',
  `platform_commission` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '平台佣金',
  `received` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '被叫方实到金币',
  `way` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '结束辅助状态（0正常结束 1无应答挂断 2被叫拒绝挂断,3主叫未接通取消 4创建通话失败取消 5通强制挂断   9未结束  ） ',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '状态（0结束1通话中 8呼叫中 9准备中） ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `deal_talks_no_unique` (`no`)
) ENGINE=InnoDB AUTO_INCREMENT=160 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `deal_messages`;
CREATE TABLE `deal_messages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
