  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发送方',
  `to_member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '接收方',
  `content` text COLLATE utf8mb4_unicode_ci COMMENT '内容',
  `price` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '聊天单价',
  `total` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费合计',
  `platform_way` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '佣金分层方式，0能量，1金币',
  `platform_rate` decimal(12,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '分层比例',
  `platform_commission` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '平台佣金',
  `received` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '接收方实到能量',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '状态(0正常  1失败 9待审核  )',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `deal_messages_no_unique` (`no`)
) ENGINE=InnoDB AUTO_INCREMENT=177 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `member_friends`;
CREATE TABLE `member_friends` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属会员',
  `to_member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '好友编号',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '9' COMMENT '状态 0:正常 1:禁用 2:冻结 ',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `member_friends_member_id_to_member_id_unique` (`member_id`,`to_member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS  `system_users`;
CREATE TABLE `system_users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '姓名',
  `email` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '邮箱',
  `mobile` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '手机号',
  `password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '密码',
  `bind_mac` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '设备绑定',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '角色,0系统管理员1运营主管',
  `login_mac` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '最后登录Mac',
  `login_ip` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '最后登录ip',
  `login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `security_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '安全码',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0:正常 1:禁用',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COLLATE utf8mb4_unicode_ci COMMENT '备注',
